import React, { Component } from "react";
import styled from "styled-components";

const Navbar = styled.aside`
  position: fixed;
  width: 320px;
  left: 0;
  top: 0;
  bottom: 0;
  padding-left: 326px;
`;

export class NavbarStyled extends React.Component {
  render() {
    return <Navbar>{this.props.children}</Navbar>;
  }
}
